(1, 'IU', 'Jakarta', '27-28 April 2024', 'K-POP', 'IU H.E.R WORLD TOUR', 'Lee Ji-eun, also known by her stage name IU, is a South Korean singer, songwriter, philanthropist, and actress. Her stage name IU, mean \"I and You become one through music.” IU is also loved by fans worldwide for her performance as an actress in dramas such as \"Moon Lovers: Scarlet Heart Ryeo,\" \"Hotel Del Luna,\" and \"My Mister.” \r\n \r\nShe debuted as a singer at the age of fifteen with Lost and Found (2008). She achieved national stardom after the release of \"Good Day\", the lead single from her 2010 album “Real”. After releasing five studio albums, ten extended plays (EPs), 47 singles (including 19 as featured artist), five single albums, two remake albums and two compilation albums, IU successful in maintaining her dominance in Korean music charts and further brace her nickname as Korea\'s \"little sister.\" She is now known as \"The Nation\'s Sweetheart\".\r\n \r\nNow she\'s finally comeback for【2024 IU H.E.R. WORLD TOUR CONCERT】IN JAKARTA! Let’s get ready to witness her amazing performance and make unforgettable memories. Tickets will be ready for sale on 8 March 2024 at 12:00 PM at iuinjakarta2024.com\r\n', , , '1000000', );
INSERT INTO `konser` (`id_artis`, `judul`, `lokasi`, `date`, `genre`, `nama_konser`, `tentang_konser`, `image`, `image_seat`, `harga_mulai`, `image_detail`) VALUES
(2, 'IVE', 'Tanggerang Selatan', '24 Agustus 2024', 'K-POP', 'SHOW WHAT i HAVE', 'DIVE Indonesia! Grup K-pop favoritmu, IVE menyapa fans Indonesia lewat tur perdana mereka, “IVE THE 1ST WORLD TOUR <SHOW WHAT i HAVE> IN JAKARTA”! Grup K-Pop sensational yang beranggotakan Gaeul, Yujin, Rei, Wonyoung, Liz, dan Leeseo akan memberikan penampilan spesial untuk DIVE Indonesia pada 24 Agustus 2024 mendatang. Bernyanyi dan berdansa bersama lagu-lagu hits mereka, seperti Off The Record, Love Dive, After LIKE, Kitsch, dan lainnya! Lihat langsung penampilan para Baddie dan beli tiket konsernya di tiket.com sekarang! Sampai jumpa di bulan Agustus, DIVE!', , , '1000000', );
INSERT INTO `konser` (`id_artis`, `judul`, `lokasi`, `date`, `genre`, `nama_konser`, `tentang_konser`, `image`, `image_seat`, `harga_mulai`, `image_detail`) VALUES
(3, 'Diana Krall', 'Jakarta', '4 Mei 2024', 'Jazz', 'Diana Krall in Jakarta', 'Masuklah ke dalam dunia jazz yang memikat ketika Diana Krall tampil di panggung utama JIEXPO Theater, Kemayoran, Jakarta, pada 4 Mei 2024 Rasakan melodi yang penuh jiwa dan vokal yang memikat, menjanjikan perjalanan musikal yang akan terus terkenang dalam ingatan Panggung yang sempurna dari JIEXPO Theater memberikan latar belakang yang indah untuk sebuah malam yang tak terlupakan bersama musisi jazz legendaris ini Bergabunglah dalam malam yang spesial ini dan jadilah bagian dari pengalaman yang tak terlupakan Nikmati malam yang memukau dari penampilan Diana Krall yang tak tertandingi di panggung JIEXPO Theater, Kemayoran, Jakarta, pada 4 Mei 2024. Rasakan melodi yang penuh jiwa dan vokal yang memikat dari sensasi jazz pemenang Grammy ini dalam nuansa yang romantis yang menjanjikan menjadi malam yang tak terlupakan. Dapatkan tiket kamu sekarang, dan bergabunglah dalam pertunjukkan musik yang tidak akan terlupakan!', , , '1000000', );
INSERT INTO `konser` (`id_artis`, `judul`, `lokasi`, `date`, `genre`, `nama_konser`, `tentang_konser`, `image`, `image_seat`, `harga_mulai`, `image_detail`) VALUES
(4, 'TVXQ', 'Jakarta', '20 April 2024', 'K-POP', 'TVXQ! Concert', 'Dilansir dari Instagramnya, MecimaPro mengatakan e-ticket konser TVXQ! juga dapat ditukar pada tanggal 20 April 2024 mulai pukul 09.00-14.30 WIB untuk seluruh kategori tiket. Lokasi penukaran tiket sendiri terletak di Hall 7, ICE BSD City, Tangerang. Bagi Cassiopeia, sebutan untuk penggemar TVXQ!, yang penukaran tiketnya diwakilkan oleh pihak ketiga diminta untuk tak lupa membawa dokumen-dokumen berupa e-voucher atau bukti pembelian tercetak, surat kuasa yang ditandatangani di atas materai dan fotokopi kartu identitas pemilik tiket dan fotokopi kartu identitas penukar tiket. MecimaPro turut menyampaikan bahwa ada sedikit perubahan untuk tempat duduk konser TVXQ! mendatang.', , , '1000000', );
INSERT INTO `konser` (`id_artis`, `judul`, `lokasi`, `date`, `genre`, `nama_konser`, `tentang_konser`, `image`, `image_seat`, `harga_mulai`, `image_detail`) VALUES
(5, 'Niall Horan', 'Jakarta', '11 Mei 2024', 'POP', 'Niall Horan Show', 'Jakarta, 12 October 2023 - The chart-topping global superstar Niall Horan has announced the following tour called “THE SHOW LIVE ON TOUR\" – his biggest tour yet and first headline run since 2018’s Flicker World Tour. Niall Horan will be adding new dates in Asia and will be performing in Jakarta on Saturday, 11 May 2024 at Beach City International Stadium. \r\n\r\nTickets will be available starting with an Artist Presale starting Monday, 16 October 2023 from 14:00 to 23:59 Jakarta time. Public On-sale will be available starting Wednesday, 18 October 2023 at 14:00 Jakarta time only at niallhoranjakarta.com \r\n\r\nGet your tickets earlier by subscribing to Niall Horan’s newsletter on niallhoran.com before Sunday, 15 October 2023 at 23:59 Jakarta time to receive the code.\r\n\r\n\r\n', , , '1000000', );
INSERT INTO `konser` (`id_artis`, `judul`, `lokasi`, `date`, `genre`, `nama_konser`, `tentang_konser`, `image`, `image_seat`, `harga_mulai`, `image_detail`) VALUES
(6, 'Incubus', 'Jakarta', '18 Mei 2024', 'ROCK', 'Incubus Asia Tour', 'US rock heavyweights Incubus will be in town on Tuesday, April 23, 2024 for a one-night only performance at the Tennis Indoor Stadium Senayan. This upcoming show marks the band’s first return to Jakarta in 6 years – it\'s a night you don’t want to miss!\r\n“INCUBUS ASIA TOUR 2024” tickets concert will be divided into 6 (six) categories, PREMIUM RED (Standing), RED (Standing), ORANGE (Seating), PURPLE (Seating), YELLOW (Seating), GREEN (Seating). Prices start from IDR 2,350,000 to IDR 950,000 (exclude Government tax 15% and 5% Admin fee). Price exclude IDR 20,000 from every ticket purchased goes to the Make Yourself Foundation (www.makeyourselffoundation.org) who Incubus have partnered with for this tour.\r\n', , , '1000000', );
