(7, 'Kyuhyun', 'Jakarta', '18 Mei 2024', 'K-POP', '2024 Kyuhyun Asia Tour ‘Restart in Jakarta\r\n', 'CK Star Entertainment proudly presents 2024 KYUHYUN ASIA TOUR \'Restart\' in Jakarta\r\nCalling all KYUpiter Indonesia! Get ready to swoon because Kyuhyun is about to melt your hearts with his debut concert in Jakarta!\r\nPrepare to be swept off your feet this May as Kyuhyun will be coming to Jakarta for his FIRST-EVER solo debut concert happening on 18 May 2024 at Tennis Indoor Senayan! This will also be last and final stop of the 2024 KYUHYUN ASIA TOUR \'Restart\' in Jakarta, and it’s going to be an amazing night you don’t want to miss.\r\nhttps://www.loket.com/event/2024-kyuhyun-asia-tour-restart-in-jakarta_ISB \r\n', , , '1000000', );

